import React from 'react';
import styled from 'styled-components';
import colors from '../style/colors'

const Nav = styled.div`

    position: absolute;
    width: 100%;
    height: 45px;

    border-bottom: 5px solid ${colors.shaddow};
    box-shadow: 0 8px ${colors.background[0]};

`
const NavTitle = styled.text`

    position: absolute;
    left: 30px;
    top: 5px;
    color: black;
    font-size: 30px;
    font-weight: bold;
    text-shadow: 2px 2px white;

`

const Navbar = (props) => {
    return(<Nav>
        <NavTitle>JM BLOG</NavTitle>
    </Nav>);
}

export default Navbar;
